INSERT INTO `about` (`id`, `title`, `description`) VALUES
(1, 'Hawa Singh', '<p>My business journey started with my father, who began making pickles in 1980. His hard work and passion made Hawa Singh Pickles a well-known name in Narela and nearby villages.</p>\r\n\r\n<p>I was born in 2004, and by the age of 10, I started learning everything from him &mdash; from ingredients to the art of pickle-making. He taught me with love and dedication.</p>\r\n\r\n<p>As times changed, I decided to take his legacy forward with a modern twist. I launched our products online, and the response was amazing! Today, we&rsquo;re expanding across states with dreams of growth and innovation &mdash; all inspired by my father&rsquo;s vision.</p>\r\n\r\n<p>Thank you for being a part of our journey.</p>');
